svg.script:
var nodeClicked = "";

function show(evt, node)
{
        var svgdoc = evt.target.ownerDocument;
        var obj = svgdoc.getElementById(node);
        var x = evt.pageX;
        var y = evt.pageY;
        console.log("show at: "+x+","+y);
        obj.setAttribute("transform","translate("+(x+2)+","+(y+2)+")");
        obj.setAttribute("display", "inline");
}

function hide(evt, node)
{
        var svgdoc = evt.target.ownerDocument;
        var obj = svgdoc.getElementById(node);
        obj.setAttribute("display" , "none");
}

function clickgroup(evt, node)                                 
{                                                              
        var svgdoc = evt.target.ownerDocument;                 
        var obj = svgdoc.getElementById(node);                 
        var a = [":", node, ":"];                          
        var b = a.reduce(function(pre, next) {                 
          return pre + next;                                   
        });                                                    
        var checkNode = nodeClicked.search(b);                 
        if ( checkNode < 0 ) {                                 
          for (const child of obj.children) {                  
            child.style.strokeWidth = "5";                   
          }       				             
          var result = nodeClicked.concat(":", node, ":"); 
          nodeClicked = result;                                
        } else {  				             
          for (const child of obj.children) {                  
            child.style.strokeWidth = "1";                   
          }       				             
          var result = nodeClicked.replace(b, "");           
          nodeClicked = result;   		             
        } 					             
}                                                              

function highlight(evt, node)                        
{                                                    
        var svgdoc = evt.target.ownerDocument;       
        var obj = svgdoc.getElementById(node);       
        for (const child of obj.children) {          
          child.style.strokeWidth = "5";           
        }                                            
}                                                    

function unhighlight(evt, node)                      
{                                                    
        var svgdoc = evt.target.ownerDocument;       
        var obj = svgdoc.getElementById(node);       
        var a = [":", node, ":"];                
        var b = a.reduce(function(pre, next) {       
          return pre + next;                         
        });                                          
        var checkNode = nodeClicked.search(b);       
        if ( checkNode < 0 ) {                       
          for (const child of obj.children) {        
            child.style.strokeWidth = "1";         
          }                                          
        }                                            
}                                                    

function displayAttributes(evt, node)
{
  var svgdoc = evt.target.ownerDocument;
  var obj = svgdoc.getElementById(node);
  console.log(obj.outerHTML);
  var rectobj = svgdoc.getElementById(node.concat("_rect"));
  console.log(rectobj);
  var width = Number(rectobj.getAttribute("width"));
  if (width < 400) {
    width = 420;
  } else {
    width += 20;
  }
  var height = Number(rectobj.getAttribute(height));
  if (height < 400) {
    height = 500;
  } else {
    height += 55;
  }
  console.log("width:", width, " height:", height);
  var rectwh = "width=";
  rectwh = rectwh.concat(width, ",height=", height);
  console.log("rectwh:", rectwh);
  var res1 = node.split("%");
  var res = res1[0].split("#");
  var myWindow = window.open("", node, rectwh);
  myWindow.document.write("<h4>", res[0], "</h4>");
  myWindow.document.write("<svg width=", width, " height=", height, " xmlns=\"http://www.w3.org/2000/svg\" xmlns:xlink=\"http://www.w3.org/1999/xlink\" >");
  myWindow.document.write(obj.outerHTML);
  myWindow.document.write("</svg>");
  var newobj = myWindow.document.getElementById(node);
  newobj.setAttribute("display" , "inline");
  newobj.style.transform="translate(0,0)";
  myWindow.focus();
  myWindow.document.close();
}
